import React from "react";
import { BrowserRouter, Route ,Routes} from "react-router-dom";

import AddProduct from "./component/AddProduct";
function App() {
  return (
    <BrowserRouter>
    <Routes >
      <Route  path="/AddProduct" element={<>AddProduct</>}/>
    </Routes>
    </BrowserRouter>
  );

}

export default App;
